import React from 'react';

const ProductTile = ({ product }) => {
  return (
    <div className="product-tile">
      <img src={product.images[1]} alt={product.name} />
      <h3>{product.name}</h3>
      <p>${product.price}</p>
    </div>
  );
};

export default ProductTile;
